import { useState } from "react";
import "./App.css";
import AddExpences from "./Components/AddExpences";
import ListExpences from "./Components/ListExpences";

function App() {
  const [Data, steData] = useState(AddedData);
  const AddedData = [
    { id: "l1", date: new Date(2021, 5, 21), title: "manoj", amount: 220 },
  ];
  const expenceData = (data) => {
    steData = { AddedData, ...data };
  };
  return (
    <div className="App">
      <AddExpences onExpenceData={expenceData} />
      <ListExpences items={AddedData} />
    </div>
  );
}

export default App;
